import Layout from '../components/Layout';

const index = () => {
    return(
        <Layout>
            <div class="container">
                <h1>Home</h1>

                <p>Excepteur sunt ut cillum et sint excepteur amet exercitation ea ad qui officia. Sunt adipisicing commodo id cupidatat ad velit cupidatat nostrud aute exercitation Lorem excepteur. Do cillum esse pariatur ad tempor deserunt adipisicing velit occaecat culpa cupidatat.</p>
            </div>
        </Layout>
    )
}

export default index;
